// src/QGIS.js
import React, { useState } from 'react';

const QGIS = ({ onBack }) => {
    const [submitted, setSubmitted] = useState(false);

    // Function to handle submission
    const handleSubmission = () => {
        // Here you can add the logic for form submission if needed
        setSubmitted(true);
        alert('I have finished and submitted the QGIS questionnaire in the Google Form.');
    };

    return (
        <div style={{ textAlign: 'center', padding: '20px' }}>
            <h1>QGIS Map</h1>
            {/* Display your QGIS images here */}
            <img src="hrv.png" alt="QGIS Example 1" style={{ width: '450px', margin: '5px' }} />
            <img src="stress.png" alt="QGIS Example 2" style={{ width: '450px', margin: '5px' }} />
            <img src="hrv.png" alt="QGIS Example 1" style={{ width: '450px', margin: '5px' }} />
            <img src="stress.png" alt="QGIS Example 2" style={{ width: '450px', margin: '5px' }} />
            {/* Add more images as needed */}
            <br />

            {submitted && (
                <div style={{ color: 'red', margin: '20px' }}>
                    I have finished and submitted the QGIS questionnaire in the Google Form.
                </div>
            )}

            <button onClick={submit} className="qgis-submit">
                Submit QGIS Questionnaire
            </button>
            <button onClick={onBack} className="qgis-back" style={{ marginLeft: '10px' }}>
                GO to D3 React App
            </button>
            <a href="https://forms.gle/hNiaZBJKq7en76wB7" target="_blank" rel="noopener noreferrer">
                <button className="qgis-questionnaire" style={{ marginLeft: '10px' }}>
                    Go to QGIS Questionnaire
                </button>
            </a>
        </div>
    );
};

export default QGIS;
